import React from "react";
import styled from "styled-components";
const Header = styled.div`

width: 50%;
height: 80px;
margin: 0 0 30px;
padding: 26px 1029px 26px 32px;
background-color: #ffffff;

`;

const Dashboard = () => {
  return (
    <>
      <Header>Header</Header>
    </>
  );
};

export default Dashboard;
